import React from "react";
import { NavLink } from "react-router-dom";
import "../Dash.css"

const Sidebar = () => {
  return (
    <div className="w-60 min-h-screen bg-gray-800 text-white p-4">
      <h2 className="text-lg font-bold">Future Coders</h2>
      <nav className="mt-4 space-y-2">
        <NavLink to="/" className="block p-2 bg-gray-700 rounded">Dashboard</NavLink>
        <NavLink to="/students" className="block p-2 bg-gray-700 rounded">Students</NavLink>
        <NavLink to="/teachers" className="block p-2 bg-gray-700 rounded">Teachers</NavLink>
      </nav>
    </div>
  );
};

export default Sidebar;
